webpackJsonp([38865100883833],{382:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Last but not least we would like to thank our Silver Sponsors. Four of them\nhave been sponsoring us in recent years already and we are very happy to have\nthem back. With their combined contribution we will be able to record all\ntalks and upload them on Youtube for the broader Python community to see.</p>\n<hr />\n<div style="margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;">\n  <a href="http://solacetech.com.sg">\n    \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 79.16666666666667%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor solacetech" title="" src="/static/sponsor-solacetech-82931638881fcea977b2183e71141a48-64e74.png" srcset="/static/sponsor-solacetech-82931638881fcea977b2183e71141a48-53de2.png 208w,\n/static/sponsor-solacetech-82931638881fcea977b2183e71141a48-5dd2f.png 416w,\n/static/sponsor-solacetech-82931638881fcea977b2183e71141a48-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  \n  </a>\n</div>\n<p>Solace Tech Pte. Ltd. is an IT training company aspiring to help\npeople to learn technology by simple premises: pre-course work before\nthe class, and blended learning. We blend classroom and self-paced\nlearning sessions to maximize hands-on ability, time flexibility, and\naffordability. Try our Python class with a guarantee: if you are still\nnot able to create a simple program, we will give you a free seat to\njoin the next class.</p>\n<hr />\n<div style="margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://jublia.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 25.625000000000004%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/jpeg;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor jublia" title="" src="/static/sponsor-jublia-26e694b100e72debb37167283ea20168-b4252.jpg" srcset="/static/sponsor-jublia-26e694b100e72debb37167283ea20168-413ba.jpg 208w,\n/static/sponsor-jublia-26e694b100e72debb37167283ea20168-8265e.jpg 416w,\n/static/sponsor-jublia-26e694b100e72debb37167283ea20168-b4252.jpg 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>Jublia is proud to do their small part within the community to sponsor\nPYCON APAC 2018. Python is the one to rule them all at Jublia.\nIt is utilised throughout their entire organisation and systems\nto deliver a stable, secure and high performance enterprise grade\nplatform.</p>\n<p>Jublia is an established global leader in business matching technology\nand event data analytics.</p>\n<p>Their mission is to empower event organisers to intelligently match\npeople and content at their events. At Jublia, they believe in enabling\npeople to discover useful content and meet relevant others through\nintelligent matching technologies. Simultaneously, they empower\norganisers with analytics to easily prove that their events are the\nundisputed channel for marketing spend by businesses in terms of ROI.</p>\n<hr />\n<div style="margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://acronis.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 504px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 36.507936507936506%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor acronis" title="" src="/static/sponsor-acronis-382b22ef0d49cde4d2697d902d76eb8d-aa692.png" srcset="/static/sponsor-acronis-382b22ef0d49cde4d2697d902d76eb8d-bb7f5.png 208w,\n/static/sponsor-acronis-382b22ef0d49cde4d2697d902d76eb8d-c8e86.png 416w,\n/static/sponsor-acronis-382b22ef0d49cde4d2697d902d76eb8d-aa692.png 504w" sizes="(max-width: 504px) 100vw, 504px">\n    </span>\n  </span>\n  </a></div>\n<p>Acronis is a Swiss-Singaporean company that sets the standard for\nhybrid cloud data protection through its backup, disaster recovery,\nand secure file sync and share solutions.</p>\n<p>Founded in 2003, Acronis protects the data of over 5 million consumers\nand 500,000 businesses in over 145 countries. With more than 100\npatents, Acronis products have been named best product of the year,\nand cover a range of features, including migration, cloning and\nreplication. Today, Acronis solutions are available worldwide through\na global network of service providers, distributors and cloud\nresellers.</p>\n<hr />\n<div style="margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://theartling.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor theartling" title="" src="/static/sponsor-theartling-4c3c2bab5799dcf31a71668a663d7db6-64e74.png" srcset="/static/sponsor-theartling-4c3c2bab5799dcf31a71668a663d7db6-53de2.png 208w,\n/static/sponsor-theartling-4c3c2bab5799dcf31a71668a663d7db6-5dd2f.png 416w,\n/static/sponsor-theartling-4c3c2bab5799dcf31a71668a663d7db6-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>The team at The Artling is passionate about art and feels that there is a\ngreat deal of undiscovered talent in Asia. They work with some of the\ntop galleries and artists in the region and feature their work online\nin order to make their work accessible to the international market. They\nare in essence an online art gallery that features a curated\ncollection of artworks, by a select group of emerging artists\nalongside artists who are much more established and exposed in the\nmarket.</p>\n<p>The Artling is a proud supporter of the Python community and has been\nusing Python since inception. They will continue to do so as they grow and\naim to disrupt the art discovery and acquisition process, whilst also\ncontributing to the cultural landscape in Asia and beyond.</p>\n<hr />\n<div style="margin-bottom: 2em; max-width: 300px; margin-left: auto; margin-right: auto;"><a href="https://bitlabstudio.com">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 480px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="sponsor bitlabstudio" title="" src="/static/sponsor-bitlabstudio-310d55b060b5c336ccb8e7995a41ce81-64e74.png" srcset="/static/sponsor-bitlabstudio-310d55b060b5c336ccb8e7995a41ce81-53de2.png 208w,\n/static/sponsor-bitlabstudio-310d55b060b5c336ccb8e7995a41ce81-5dd2f.png 416w,\n/static/sponsor-bitlabstudio-310d55b060b5c336ccb8e7995a41ce81-64e74.png 480w" sizes="(max-width: 480px) 100vw, 480px">\n    </span>\n  </span>\n  </a></div>\n<p>Bitlab Studio (formerly known as Bitmazk) is a Singapore based full\nstack web agency specialized on creating web applications and mobile\napps built with Python, Django, ReactJS and ReactNative.</p>\n<p>Since we have sponsored PyCon Sigapore in 2016, our team has grown and\nour focus has shifted more towards mobile apps with ReactNative, while\nDjango and GraphQL remain our bread and butter on the backend side of\nthings. We are always looking for talented full stack developers in\nthe region.</p>\n<hr />\n<p>Solacetech and Acronis will have a booth at the conference, so\ndon\'t miss your chance to get to know them in person when you attend the\nconference!</p>',frontmatter:{date:"May 25, 2018",path:"/news/silver-sponsors",title:"Silver Sponsors for PyCon APAC 2018"}}},pathContext:{}}}});
//# sourceMappingURL=path---news-silver-sponsors-94584e42d805f9dbfaf8.js.map